import React from 'react';

function Home() {
    return(
        <section>
            <div class="container-fluid">
                let text = "r-EZ-ipe"
                let result = text.fontcolor("green");
                <h1 class="mt-5">result</h1>
                <p>It should be easy right?</p>
            </div>
        </section>
    );
}

export default Home;
